import React from "react";
import styled from "styled-components";

export const Header = styled.section`
    width: 100%;
    height: 80vh;
    background-color: #282c34;
    position: relative;
    display: flex;
    justify-content: center;
`

export const MainHeader = styled.div`
    position: relative;    
`
